import './App.css';

function Todotable(){
return (
<div className='todobox'>
  <Todoitem></Todoitem>
  <Todoitem></Todoitem>

  <button className='addbuttontodobox'>Add new Item</button>
</div>
)
}
function Todoitem(){
return(
  <>
  <div className='todoitem'>
  <div className='leftofitem'>
  <div className='top'>name  due 10pm</div>
    <div className='description'>description</div>
    <div className='end'>created at 10am</div>
  </div>
  <div className='rightofitem'>
    <button>Done</button>
  </div>
</div>
</>
)
}
function Additemform(){
  return(
    <div className='addingform'>
      <form act>
        <input name='name' placeholder='Item name'></input>
        <textarea placeholder='description'></textarea>
        <button>Add</button>
      </form>
    </div>
  )
}
function Additembox(){
}
function App() {
  return (
    <div className="App-header">
      <Todotable/>
      <Additemform/>
    </div>
  );
}

export default App;
